INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Sigourney Weaver', '1949-10-08', 'Manhattan, New York City, New York, USA', 'nm0000244', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTk1MTcyNTE3OV5BMl5BanBnXkFtZTcwMTA0MTMyMw@@._V1_.jpg', 'Sigourney Weaver was born Susan Alexandra Weaver in Leroy Hospital in Manhattan, New York City. Her father, TV producer Sylvester L. Weaver Jr., originally wanted to name her Flavia, because of his passion for Roman history (he had already named her elder brother Trajan).');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Felicity Jones', '1983-10-17', 'Birmingham, West Midlands, England, UK', 'nm0428065', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjA0MTIwMzIyN15BMl5BanBnXkFtZTgwNDEyMzg1NDE@._V1_.jpg', 'Felicity Rose Hadley Jones is an English actress. Jones was born in Birmingham, West Midlands, and grew up in Bournville. Her parents met while working at the Wolverhampton Express and Star. Her father was a journalist while her mother was in advertising.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Toby Kebbell', '1982-07-09', 'Pontefract, Yorkshire, England, UK', 'nm1527905', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTcwMjk0NTI0M15BMl5BanBnXkFtZTcwNzcxOTYxNA@@._V1_.jpg', 'Tobias Alistair Patrick Kebbell was born in 1982 in Pontefract, Yorkshire, to Michelle (Mathers), a landscape gardener and cook, and Robert Kebbell, an engineer. He moved to Nottinghamshire, where he grew up. His ancestry includes Irish, English, and Scottish.');
