INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Lily-Rose Aslandogdu', 'Unknown', '', 'nm6982756', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Lily joined Alphabet Agency late 2011, after winning the face of Argos a competition in which the prize was a year\'s modeling contract with Alphabet Kidz .Lily has since gone on to star in a variety of projects. Lily\'s most recent project sees her starring beside Liam Neeson in feature film A Monster Calls based on a novel written by Patrick Ness.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Geraldine Chaplin', '1944-07-31', 'Santa Monica, California, USA', 'nm0001036', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTU4OTAzMTkxOF5BMl5BanBnXkFtZTYwMDA5OTc3._V1_.jpg', 'Geraldine Leigh Chaplin was born in Santa Monica, California, to Oona Chaplin (née O\'Neill) and legendary entertainer Charles Chaplin (A.K.A. Charlie Chaplin). She is a granddaughter of playwright Eugene O\'Neill and a great-granddaughter of stage actor James O\'Neill.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Liam Neeson', '1952-06-07', 'Ballymena, Co. Antrim, Northern Ireland, UK', 'nm0000553', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjA1MTQ3NzU1MV5BMl5BanBnXkFtZTgwMDE3Mjg0MzE@._V1_.jpg', 'Liam Neeson was born on June 7, 1952 in Ballymena, Northern Ireland, UK, to Katherine (Brown), a cook, and Bernard Neeson, a school caretaker. Liam worked as a forklift operator for Guinness, truck driver, assistant architect and an amateur boxer. He had originally sought a career as a teacher by attending St.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Lee Bolton', 'Unknown', '', 'nm4216326', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Award Winning Director Lee Bolton was born in Salford, Manchester. After many years working in the Industry he set up film company Elerby Studios, Originally based in Bolton now based in the Northern Quarter, Manchester. Working with many industry people as possible, Lee developed his work studying their works.');
